// src/seoin/Seoin.jsx
import React, { useEffect } from "react";
import "./style.css";

const Seoin = () => {
  useEffect(() => {
    // JavaScript 기능이 필요하면 여기에 추가할 수 있습니다.
  }, []);

  return (
    <div className="desktop">
      <header className="header">
        <img src="frontend/co-deep-frontend(Final)/src/seoin/images/logo.png" alt="PoliTracker" className="logo" />
        <button className="home-button">Home</button>
      </header>

      <main>
        <h1 className="main-title">의안 투표 추적</h1>
        <div className="legend">
          <span className="legend-item legend-approve">찬성</span>
          <span className="legend-item legend-against">반대</span>
          <span className="legend-item legend-abstain">기권</span>
        </div>

        <div id="process-block" className="process-block"></div>

        <button className="load-more">더보기</button>
      </main>

      <footer className="footer">
        <p>성균관대학교 트래커스꾸</p>
        <p>서울특별시 종로구 성균관로 25-2</p>
        <p>trackerskku@g.skku.edu</p>
      </footer>
    </div>
  );
};

export default Seoin;
